insert into lang_messages values ('Bad_Query_Msg', 'intranet-search-pg', 'de_DE', 'Die &amp;#93;po&amp;#91; Suchmaschine kann komplexe Abfragen, die mehr als ein Wort enthalten, bearbeiten. &lt;br&gt;\r\n Sie müssen der Suchemaschine jedoch sagen, wie sie suchen soll:\r\n &lt;p&gt;\r\n &lt;ul&gt;\r\n &lt;li&gt;Suchbegriff1 &lt;b&gt;&amp;&lt;/b&gt; Suchbegriff2:&lt;br&gt;Es werden alle Objekte gesucht, die beide Suchbegriffe enthalten.&lt;br&gt;&amp;nbsp;\r\n &lt;li&gt;Suchbegriff1 &lt;b&gt;|&lt;/b&gt; Suchbegriff2:&lt;br&gt;Es werden alle Objekte gesucht, die einen der beiden Suchbegriffe enthalten.&lt;br&gt;&amp;nbsp;\r\n &lt;li&gt;&lt;b&gt;!&lt;/b&gt;Suchbegriff:&lt;br&gt;Es werden alle Objekte gesucht, die den Suchbegriff NICHT enthalten.&lt;br&gt;&amp;nbsp;\r\n &lt;li&gt;&lt;b&gt;(&lt;/b&gt;Abfrage&lt;b&gt;)&lt;/b&gt;:&lt;br&gt;Sie können Klammern verwenden, um Abragen zu unterteilen.&lt;br&gt;&amp;nbsp;\r\n &lt;/ul&gt;\r\n \r\n &lt;H3&gt;Beispiele&lt;/h3&gt;\r\n &lt;ul&gt;\r\n &lt;li&gt;&lt;b&gt;'Projekt &amp; offen'&lt;/b&gt;:&lt;br&gt;Es werden alle Objekte gesucht, die 'Projekt' und 'offen' enthalten.&lt;br&gt;&amp;nbsp;\r\n &lt;li&gt;&lt;b&gt;'Projekt | offen'&lt;/b&gt;:&lt;br&gt;Es werden alle Objekte gesucht, die entweder 'Projekt' oder 'offen' enthalten.&lt;br&gt;&amp;nbsp;\r\n &lt;/ul&gt;\r\n \r\n ');
